import React, { useState } from 'react';
import { DropdownButton, Dropdown } from 'react-bootstrap';

function TestC() {
  const [selectedMonth, setSelectedMonth] = useState('');

  const handleMonthChange = (eventKey, event) => {
    // Convert the month string to a numeric index
    const monthIndex = months.indexOf(eventKey);
    setSelectedMonth(monthIndex >= 0 ? monthIndex : '');
    console.log(selectedMonth);
  };

  const months = ['jan', 'may', 'oct'];

  return (
   <div> <DropdownButton id="monthDropdown" title={`Select Month: ${selectedMonth || 'All Months'}`} onSelect={handleMonthChange}>
